import {useState, useEfect} from "react";

import './register.css'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function Register() {

const [email, setEmail] = useState("")
const [fullName, setFullName] = useState("")
const [username, setUsername] = useState("")
const [password, setPassword] = useState("")

    return (
        <div className='register'>
            <div className='register-wrapper'>
            <h1>Instagram</h1>
            <p>Sign up to see photos and videos from your friends.</p>

            <Box className="form-inputs">
      <TextField 
      className='register-input' id="demo-helper-text-misaligned-no-helper"
      label="Email"
      value={email}
      onChange={(e) => {setEmail(e.target.value)}} />

      <TextField className='register-input' id="demo-helper-text-misaligned-no-helper" 
      label="Full Name"
      value={fullName}
      onChange={(e) => {setFullName(e.target.value)}} />

      <TextField className='register-input' id="demo-helper-text-misaligned-no-helper" 
      label="Username"
      value={username}
      onChange={(e) => {setUsername(e.target.value)}} />

      <TextField
          id="standard-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
          variant="outlined"
          className="register-input"
          value={password}
          onChange={(e) => {setPassword(e.target.value)}}
        />
        <button className='register-input register-btn'>Sign up</button>
    </Box>

    </div>
        </div>
    )
}
